function getKeywords(urls){
    var keywords=[];
    for(var i=0;i<urls.length;i++){
        try {
            var params = decodeURI(urls[i]).split('?')[1];
            if(params.indexOf('word')>-1 || params.indexOf('wd')>-1){
                var reqObj = getTheRequest(params);
                reqObj.word!==undefined?keywords.push(reqObj.word):reqObj.wd!==undefined?keywords.push(reqObj.wd):null;
            }
        } catch (error) {
            console.log('error',urls[i])
            continue;
        }
    }
    console.log('keywords',JSON.stringify(keywords))
}
function getTheRequest(params){
    var theRequest = {};
    var strs = params.split('&');
    for(var i = 0; i < strs.length; i ++) {   
        theRequest[strs[i].split("=")[0]]=strs[i].split("=")[1];   
    }
    return theRequest;
}